import React from "react";
import { MDBFooter, MDBBtn } from "mdbreact";

import { MDBLink } from "mdbreact";
import axios from "axios";

const onLogout = () =>{
    axios.post("http://localhost/spare_parts/logout.php")
        .then(value => console.log(value.data));
}

const Copyrights = (props) => {
  return (
    <MDBFooter
      // className={props.className}
      style={{ ...props.style, zIndex: 2, backgroundColor: "transparent" }}
    >
      <MDBLink to="/sale" target="_blank" style={{
          float: "right",
      }}>
        <MDBBtn
          size="lg"
          gradient="blue"
          rounded={true}
          style={{
              width: "150px",
            fontWeight: "bold",
          }}
        >
          {/* <MDBIcon icon="bolt" /> */}
          Sale
        </MDBBtn>
      </MDBLink>
        <MDBBtn
            size="lg"
            gradient="blue"
            rounded={true}
            style={{
                width: "150px",
                float: "right",
                marginRight: 50,
                marginTop: 15,
                fontWeight: "bold",
            }}
            onClick={() => {
                onLogout();
                props.history.push("/login");
            }}
        >
            Logout
        </MDBBtn>
    </MDBFooter>
  );
};
export default Copyrights;
